import React from 'react';
import { Container } from 'react-bootstrap';

const RadyDzielnicy = () => {
  return (
    <Container>
      <h1>Rady Dzielnicy</h1>
      <p>Informacje o Radach Dzielnicy.</p>
    </Container>
  );
};

export default RadyDzielnicy;
